import React from "react";
import { Nav } from "react-bootstrap";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Estudios from "./Estudios";
import Skills from "../Pages";
import Proyectos from "../pages/Proyectos";
import Experiencia from "./Experiencia";
import Home from "./Home";
import Bv from "../img/bv.png";

class Navbar extends React.Component {
  render() {
    return (
      <React.Fragment>
        <Router>
          <Nav
            variant="tabs"
            defaultActiveKey="/home"
            className="justify-content-center h6 p-3 bg-success align-items-center shadow"
          >
            <Nav.Item>
              
              <Nav.Link
                as={Link}
                to="/"
                className="text-white "
                id="nav1"
              >
                <img
                src={Bv}
                as={Link}
                to="/"
                style={{ width: "40px", borderRadius: "100%" }}
              ></img>
              </Nav.Link>
            </Nav.Item>
             <Nav.Item>
              <Nav.Link
                as={Link}
                to="/estudios"
                className="text-white"
                id="nav1"
              >
                Estudios
              </Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link as={Link} to="/skills" className="text-white">
                Skills
              </Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link as={Link} to="/proyectos" className="text-white">
                Proyectos
              </Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link as={Link} to="/experiencia" className="text-white">
                Experiencia
              </Nav.Link>
            </Nav.Item> 
          </Nav>

          <Switch>
            <Route exact path="/" component={Home} />
            <Route exact path="/estudios" component={Estudios} />
            <Route exact path="/skills" component={Skills} />
            <Route exact path="/proyectos" component={Proyectos} />
            <Route exact path="/experiencia" component={Experiencia} />
          </Switch>
        </Router>
      </React.Fragment>
    );
  }
}

export default Navbar;
